      "text": "16. Bey Herrn Rudolf Ramßberger an der Ruth, als ift extra gutter Holänder-Tabad in blivernen Pfunden, Buchfen à 10 Pfunden, wie auch andere Ert. Wincnt à 8 Pf. zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "17. Wo guter Rett große Bohnen zum Säen, und kleine weiße dito zum Kochen in billigem Preiß zu haben, ift im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "18. Bleys Barrelen oder Preßfäßer, ßufs, wie auch ein ganz neuer Eßer, Butt, mitt mäßiger Größe, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "19. Bey Herrn Bürchard zum Rießen und extra neue gute Italiänische Reißen, dito große Mörsertruben mit und ohne Stiel, Höschnuß, bürre Morcheln, feiner Epßchcoladen, alles in billigem Preiß zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "20. Zumal Eäßt, neuer Batten in billigem Preiß, im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "21. Bey Herrn Jacob Grimm Buchbinder ift zu haben: 1.) Ein kräftig-Allas von 95 Böchle Landkarten, Cübuben, Plans von Städten und Belagerungen des Reißen Kriegs. 2.) Die Welt in einer Nuß mit Kupfern. 3.) Die Durchlauchtige Welt, 4.) Deil mit Rübaben, 4.) Journal du camp de Compiegne avec nigres."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "22. Gut und billig zu haben: Ein gutes in ein Birnbaß ßaus auf das Land oder in ein Bad biemlich obentagelblich im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "23. Eine Vorrichtung in der nefdenner Borftadt mit 2 Etaben, Kammern famt einer großen fen Wertfchaft, Eßfing und einem fobenen zu wohlben Mäher und Gürten, weshalb ift bei Herrn Jacob Bindlin dem Weinmann anzufragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "24. Ein Grund, welcher circa 600 Eßer ßauf Eamen andere liefern tönte, möchte aber folchen vorbereitete vorbehalten, oft offen folche gen Salthero in billigem Preiß, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "25. Wo guter alter weißer Wein in Fäßen, ift bei Herrn Michael Fuchß dem Rüfer zu verkaufen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "26. Circa 6. Eaum circa guter alter nur roffer fefienner Wein, 10 gut als Steinerburger oder Burggunder, in billigem Preiß, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "27. Zwey Etheilflein weiffen Rhein von 1760, à 8 ßund 10 à der Eaum im ersten, und à 8 ßund im andern, wenn nach Gefieben zu haben, im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "28. Ein Etof Eru à 3 Thalen Matten vorun Eichenherr, Ehr oberfalls der Echbenbraut, keinet im Ettädtlein von 7 Eaumen rothes Bülger-Wein von 1750. Ehr rotb-und lauter, im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "29. Auf E. E. Eunft am Baren hat wiederum neue Eaure-Rüben in billigem Preiß zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "30. Ein recht Echarflacben Gamifch und Eofen in billigem Preiß, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "31. Im Difenburger ßof ift wohlbeernährter Baur zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "32. Ein Ereumhaußlein bei der Eteinen-Möblin mit aller Kommlichkeit, im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "33. Bey weitem roffer und meiffer Burgunder, wie auch Mürgau=Rhein, Diccenweiß wegen Mangel§ Mügeß, wie auch rotb und weiffer 4 bis 5 jähriger Marggrafer Wein in billigem Preiß zu haben, ift im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "34. Feine beittereßte Hamurger-Etrich-Nöblen ßaß ßund à 6 ßund, 10 diefelbe Mundweifen zu haben, ift im Berichtbaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "35. Denn Eolbach des Eiegrifß Befauffung im Eptag jäbflich mit 4 Etaben, 3 Kammern, 1 ft. entwickel in verfaufen, oder fannetbhaft zu verleihen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "36. Beifle und rothe Mataräfer, Beine von 1760. wegen in billigem Preiß nach Gefieben zu haben, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "37. Ein Eamenliff in E. E. Bereß Kirch auf bem Eeint. Neun ein gutes Iombeau=Berblein mit grünen weiffen Umhängen, in billigem Preiß, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "38. Ein Eaufichtblatten mit einem Ebönen Bild und ßügelbrett in billigem Preiß, im Berichtbaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": null,
      "text": "39. Der Barrenfeller=ßof zu St. Peter, mit Eaichen, Etaubung, Eette ift, wie ber Bingens feien wird, in Ermanglung eines Eauferß."
    }
